webpackJsonp([31092241008505],{5812:function(e,t){e.exports={data:{post:{html:"<p>After the <a href=\"http://www.amazon.de/exec/obidos/ASIN/B00006C76Y\">The Ketchup Song</a> (like the Macarena, only the <a href=\"http://www.song-texte.de/song-texte/index.php3?aktion=show_song&id=7b4b05e60003d736dbbbbba0&amp;band_id=342953730003d7215f434a4b\">lyrics</a> are nonsense), we now have <a href=\"http://www.royal-ts.de/mtarchives/000881.php\">Der Steuersong</a> \"The Tax Song\" by a Schr√∂der imitator, except the <a href=\"http://www.song-texte.de/songtexte-id/285193f80003dd05fade2550/163438b20003dd05fade9a8f/\">lyrics</a> are not nonsense, but bitter reality.</p>\n<p><em>I'm raising all your taxes<br />\nElected is elected, you can't fire me now<br />\nThat's what's cool* about democracy</em></p>\n<p>*The German text, 'das ist ja das Geile an der Demokratie', is just slightly vulgar. 'Horny' would be a better translation for <a href=\"http://dict.leo.org/?search=geil\">'geil'</a>, but 'horny for democracy' makes no sense in English, even if we do speak of 'lust for power'.</p>",fields:{title:"Elected is elected, you can't fire me now",date:"13 Nov 2002",url:"https://papascott.de/2002-11-13-elected-is-elected-you-cant-fire-me-now/"}}},pathContext:{slug:"/2002-11-13-elected-is-elected-you-cant-fire-me-now/",prev:{fields:{title:"RSS Uproar",date:"10 Nov 2002",slug:"/2002-11-10-rss-uproar/"}},next:{fields:{title:"On The Cover of the Rolling Stone",date:"13 Nov 2002",slug:"/2002-11-13-on-the-cover-of-the-rolling-stone/"}}}}}});
